const lengthOfLongestSubstring = function(s) {
	let max_len = 0;
	let curr = 0;
	const hash = {};
	if(s.length < 2) {
		return s.length;
	}
	for(let i = 0; i < s.length; i++) {
		// if index isnt in the hash --> add 1 to current
		if(hash[s[i]] == null) {
			curr += 1;
		}
		// else curr is either index - index in has OR curr + 1 (smallest)
		else {
			curr = Math.min(i - hash[s[i]], curr + 1);
		}
		// Saves longest curr
		max_len = Math.max(max_len, curr);

		// add i to hash
		hash[s[i]] = i;
	}
	return max_len;
};

